import "./Header.css";
import { NavLink } from "react-router-dom";


function Header() {
    return (
        <div className="header">
            <NavLink className="header-button" to="/">
                <img className="home-icon" src={HomeIcon} />
                <p className="navbar_text">about us</p>
            </NavLink>
        </div>
    );
}

export default Header;
